import React from 'react';
import TopNav from '../TopNav/TopNav';
import './Header.css';

function Header() {
    return (
        <div className="header">
            <div className="logo">
                <img src="https://pacinst.org/wp-content/uploads/2018/08/logo-copy.png" alt="logo" />
            </div>
            <TopNav/>
        </div>
    )
}

export default Header
